    const onChange = (event) => {
        console.log(event.target.name)
    }
    const onSubmit = (event) => {
        event.preventDefault();
    }
    return (
        <div>
            <form onSubmit={onSubmit}>
                <input
                    name="Email"
                    type="text"
                    placeholder="Email"
                    required
                    value={email}
                    onChange={onChange}
                ></input>
